import React from "react";
import Text from "../../components/Text";
import Title from "../../components/Title";
import HtmlText from "../../components/HtmlText";
import Image from "../../components/Image";
import Statistic from "../../components/Statistic";
import {getKeyMap} from "../../Services/SportMap";


export default function MatchContent(props) {
    console.log(props);

    return(
      <div className={"lg:px-20 py-5 lg:py-10 px-5"}>
          {props.activeTab === "prehled" && (
            <div>
                <Title className={"font-bold text-xl lg:text-2xl"} text={"PÅ™ehled"}></Title>
            </div>
          )}
          {props.activeTab === "sestavy" && (
              <div>
                  <Title className={"font-bold text-xl lg:text-2xl mb-3"} text={"Sestavy"}></Title>
                  {props.lineup.length === 0 ? (
                      <Text text="Sestavy nejsou dostupnÃ©" className="text-center text-sm lg:text-lg font-bold" />
                  ) : (
                      <div className="flex justify-between">
                          {/* DomÃ¡cÃ­ tÃ½m */}
                          <div id={props.data.homeTeam.id}>

                              {/* ZÃ¡kladnÃ­ sestava */}
                              <Text text="ZÃ¡kladnÃ­ sestava" className="font-semibold text-lg mb-2" />
                              {props.lineup
                                  .filter(player => player.team.id === props.data.homeTeam.id && player.is_starter)
                                  .map(player => (
                                      <div key={player.id} className="flex items-center space-x-3 mb-2">
                                          <Image
                                              src={player.player.image_src}
                                              alt={player.player.first_name}
                                              className="lg:w-10 lg:h-10 md:w-10 md:h-10 h-8 w-8 rounded-full lg:bject-cover"
                                          />
                                          <Text
                                              text={`${player.player.number} - ${player.player.first_name} ${player.player.last_name} (${player.player.position})`}
                                          />
                                      </div>
                                  ))}

                              {/* NÃ¡hradnÃ­ci */}
                              <Text text="NÃ¡hradnÃ­ci" className="font-semibold text-lg mt-4 mb-2" />
                              {props.lineup
                                  .filter(player => player.team.id === props.data.homeTeam.id && !player.is_starter)
                                  .map(player => (
                                      <div key={player.id} className="flex items-center space-x-3 mb-2">
                                          <Image
                                              src={player.player.image_src}
                                              alt={player.player.first_name}
                                              className="lg:w-10 lg:h-10 md:w-10 md:h-10 h-8 w-8 rounded-full lg:bject-cover"
                                          />
                                          <Text
                                              text={`${player.player.number} - ${player.player.first_name} ${player.player.last_name} (${player.player.position})`}
                                          />
                                      </div>
                                  ))}
                              <Text text="TrenÃ©r" className="font-semibold text-lg text-left mt-4 mb-2" />
                              <Text className={"text-left"} text={props.data.homeTeam.coach}></Text>
                          </div>

                          {/* HostujÃ­cÃ­ tÃ½m */}
                          <div id={props.data.awayTeam.id}>

                              {/* ZÃ¡kladnÃ­ sestava */}
                              <Text text="ZÃ¡kladnÃ­ sestava" className="font-semibold text-lg text-right mb-2" />
                              {props.lineup
                                  .filter(player => player.team.id === props.data.awayTeam.id && player.is_starter)
                                  .map(player => (
                                      <div key={player.id} className="flex items-center space-x-3 mb-2 justify-end">
                                          <Text className={"text-right"}
                                              text={`(${player.player.position}) ${player.player.last_name} ${player.player.first_name} - ${player.player.number}`}
                                          />
                                          <Image
                                              src={player.player.image_src}
                                              alt={player.player.first_name}
                                              className="lg:w-10 lg:h-10 md:w-10 md:h-10 h-8 w-8 rounded-full lg:bject-cover"
                                          />
                                      </div>
                                  ))}

                              {/* NÃ¡hradnÃ­ci */}
                              <Text text="NÃ¡hradnÃ­ci" className="font-semibold text-lg text-right mt-4 mb-2" />
                              {props.lineup
                                  .filter(player => player.team.id === props.data.awayTeam.id && !player.is_starter)
                                  .map(player => (
                                      <div key={player.id} className="flex items-center space-x-3 mb-2 justify-end">
                                          <Text className={"text-right"}
                                              text={`(${player.player.position}) ${player.player.last_name} ${player.player.first_name} - ${player.player.number}`}
                                          />
                                          <Image
                                              src={player.player.image_src}
                                              alt={player.player.first_name}
                                              className="lg:w-10 lg:h-10 md:w-10 md:h-10 h-8 w-8 rounded-full lg:bject-cover"
                                          />
                                      </div>
                                  ))}
                              <Text text="TrenÃ©r" className="font-semibold text-lg text-right mt-4 mb-2" />
                              <Text className={"text-right"} text={props.data.awayTeam.coach}></Text>
                          </div>
                      </div>
                  )}
              </div>
          )}

          {props.activeTab === "statistiky" && (
              <div>
                  <Title className={"font-bold text-xl lg:text-2xl"} text={"Statistiky"}></Title>
                  <div className="mt-4">
                      {statistics.map((stat, index) => (
                          <Statistic
                              key={index}
                              title={stat.title}
                              homeValue={stat.homeValue}
                              awayValue={stat.awayValue}
                              sportType={props.data.sport.name}
                          />
                      ))}
                  </div>
              </div>
          )}
          {props.activeTab === "analytika" && (
              <div>
                  <Title className={"font-bold text-xl lg:text-2xl mb-3"} text={"AnalÃ½za zÃ¡pasu"}></Title>
                  {props.analysis.content && <HtmlText text={props.analysis.content}></HtmlText>}
                  {!props.analysis.content && <p>AnalÃ½za zÃ¡pasu nenÃ­ k dispozici</p>}
              </div>
          )}
          {props.activeTab === "sazeni" && (
              <div>
                  <Title className={"font-bold text-xl lg:text-2xl mb-3"} text={"SÃ¡zkovÃ¡ poradna"}></Title>
                  {props.betting.content && <HtmlText text={props.betting.content}></HtmlText>}
                    {!props.betting.content && <p>SÃ¡zkovÃ¡ poradna nenÃ­ k dispozici</p>}
              </div>
          )}
      </div>
    );
}
